// File: PartnerToken/VPANDA.sol



pragma solidity ^0.8.0;




// import "./lib/IUniswapV2Factory.sol";
// import "./lib/IUniswapV2Pair.sol";
// import "./lib/IUniswapV2Router02.sol";

interface ISwapFactory {
    function getPair(address token0, address token1)
        external
        view
        returns (address);
}

contract VPANDA is Context, IERC20, Ownable {
    using SafeMath for uint256;
    mapping(address => uint256) private _rOwned;
    mapping(address => uint256) private _tOwned;

    mapping(address => mapping(address => uint256)) private _allowances;
    uint256 private constant MAX = ~uint256(0);

    //Total Supply
    uint8 private _decimals = 18;
    uint256 private _tTotal = 2300000 * 10**18;

    uint256 private _rTotal = (MAX - (MAX % _tTotal));
    uint256 public _tTaxFeeTotal;

    string private _name = "VPANDA DAO";
    string private _symbol = "VPANDA";

    mapping(address => bool) public _isExcludedDividend; //
    mapping(address => bool) public _isExcludedFeeFrom; // fee free from
    mapping(address => bool) public _isExcludedFeeTo; // fee free to
    address[] private _excluded;

    bool private feeIt = true;

    address public burnAddress =
        address(0x000000000000000000000000000000000000dEaD);
    address private devAddress =
        address(0x21A99FeA7F0aBAad97dc6Cdb32349339143F2e2b);
    address public constant usdt =
        address(0x55d398326f99059fF775485246999027B3197955);
    address public constant wbnb =
        address(0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c);
    ISwapFactory public constant pancakeSwapFactory =
        ISwapFactory(address(0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73));
    mapping(address => bool) public isOtherSwapPair;

    uint256 transferAmountLimit = 1000 * 10**_decimals;

    bool public paused = false;
    event Pause();
    event Unpause();

    constructor() {
        _tOwned[_msgSender()] = _tTotal;
        _rOwned[_msgSender()] = _rTotal;

        setExcludedDividend(_msgSender());
        setExcludedDividend(burnAddress);
        setExcludedDividend(address(this));
        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    /**
     * @dev Modifier to make a function callable only when the contract is not paused.
     */
    modifier whenNotPaused() {
        require(!paused);
        _;
    }

    /**
     * @dev Modifier to make a function callable only when the contract is paused.
     */
    modifier whenPaused() {
        require(paused);
        _;
    }

    /**
     * @dev called by the owner to pause, triggers stopped state
     */
    function pause() public onlyOwner whenNotPaused {
        paused = true;
        emit Pause();
    }

    /**
     * @dev called by the owner to unpause, returns to normal state
     */
    function unpause() public onlyOwner whenPaused {
        paused = false;
        emit Unpause();
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function setTransferLimit(uint256 amount) public onlyOwner {
        transferAmountLimit = amount * 10**_decimals;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcludedDividend[account]) return _tOwned[account];
        else return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function setDevAddress(address _dev) public onlyOwner {
        require(_dev != devAddress, "already set _dev");
        devAddress = _dev;
    }

    function isContract(address account) internal view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }

    function isSwapPair(address pair) public view returns (bool) {
        if (pair == address(0)) {
            return false;
        }

        return
            pancakeSwapFactory.getPair(address(this), usdt) == pair ||
            pancakeSwapFactory.getPair(address(this), wbnb) == pair ||
            isOtherSwapPair[pair];
    }

    function addOtherSwapPair(address _swapPair) external onlyOwner {
        require(_swapPair != address(0), "_swapPair can not be address 0");
        isOtherSwapPair[_swapPair] = true;
    }

    function removeOtherSwapPair(address _swapPair) external onlyOwner {
        require(_swapPair != address(0), "_swapPair can not be address 0");
        isOtherSwapPair[_swapPair] = false;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(!paused, "paused");
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        bool isBuy = isSwapPair(from);
        bool isSell = isSwapPair(to);

        if (isBuy || isSell) {
            if (transferAmountLimit > 0) {
                require(
                    amount <= transferAmountLimit,
                    "transfer amount out of limit"
                );
            }
        }

        bool takeFee = true;

        if (_isExcludedFeeFrom[from] || _isExcludedFeeTo[to]) {
            takeFee = false;
        }
        _tokenTransfer(from, to, amount, takeFee);
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool takeFee
    ) private {
        if (!takeFee) removeAllFee();

        if (_isExcludedDividend[sender] && !_isExcludedDividend[recipient]) {
            _transferFromExcluded(sender, recipient, amount);
        } else if (
            !_isExcludedDividend[sender] && _isExcludedDividend[recipient]
        ) {
            _transferToExcluded(sender, recipient, amount);
        } else if (
            !_isExcludedDividend[sender] && !_isExcludedDividend[recipient]
        ) {
            _transferStandard(sender, recipient, amount);
        } else if (
            _isExcludedDividend[sender] && _isExcludedDividend[recipient]
        ) {
            _transferBothExcluded(sender, recipient, amount);
        } else {
            _transferStandard(sender, recipient, amount);
        }

        if (!takeFee) restoreAllFee();
    }

    function _transferStandard(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (uint256 tTransferAmount, uint256 tDev, uint256 tFee) = _getTValues(
            tAmount
        );
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tTransferAmount,
            tFee,
            _getRate()
        );
        _rOwned[sender] = _rOwned[sender].sub(rAmount, "sub1 rAmount");
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeTax(tDev);
        _reflectFee(rFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferToExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (uint256 tTransferAmount, uint256 tDev, uint256 tFee) = _getTValues(
            tAmount
        );
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tTransferAmount,
            tFee,
            _getRate()
        );
        _rOwned[sender] = _rOwned[sender].sub(rAmount, "sub2 rAmount");
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeTax(tDev);
        _reflectFee(rFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (uint256 tTransferAmount, uint256 tDev, uint256 tFee) = _getTValues(
            tAmount
        );
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tTransferAmount,
            tFee,
            _getRate()
        );
        _tOwned[sender] = _tOwned[sender].sub(tAmount, "sub3 tAmount");
        _rOwned[sender] = _rOwned[sender].sub(rAmount, "sub3 rAmount");
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeTax(tDev);
        _reflectFee(rFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferBothExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (uint256 tTransferAmount, uint256 tDev, uint256 tFee) = _getTValues(
            tAmount
        );
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tTransferAmount,
            tFee,
            _getRate()
        );
        _tOwned[sender] = _tOwned[sender].sub(tAmount, "sub4 tAmount");
        _rOwned[sender] = _rOwned[sender].sub(rAmount, "sub4 rAmount");
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeTax(tDev);
        _reflectFee(rFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _takeTax(uint256 tDev) private {
        uint256 currentRate = _getRate();
        uint256 rDev = tDev.mul(currentRate);
        _rOwned[devAddress] = _rOwned[devAddress].add(rDev);
        if (_isExcludedDividend[devAddress]) {
            _tOwned[devAddress] = _tOwned[devAddress].add(tDev);
        }
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function tokenFromReflection(uint256 rAmount)
        public
        view
        returns (uint256)
    {
        require(
            rAmount <= _rTotal,
            "Amount must be less than total reflections"
        );
        uint256 currentRate = _getRate();
        return rAmount.div(currentRate);
    }

    receive() external payable {}

    function _reflectFee(uint256 rFee) private {
        _rTotal = _rTotal.sub(rFee, "reflect fee");
    }

    //Get the transfer amount of the reflection address
    function _getTValues(uint256 tAmount)
        private
        view
        returns (
            uint256 tTransferAmount,
            uint256 tDev,
            uint256 tFee
        )
    {
        if (!feeIt) {
            return (tAmount, 0, 0);
        }
        tDev = tAmount.mul(1).div(100);
        tFee = tAmount.mul(2).div(100);
        tTransferAmount = tAmount.sub(tDev).sub(tFee);
    }

    function _getRValues(
        uint256 tAmount,
        uint256 tTransferAmount,
        uint256 tFee,
        uint256 currentRate
    )
        private
        pure
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rTransferAmount = tTransferAmount.mul(currentRate);
        uint256 rFee = tFee.mul(currentRate);
        return (rAmount, rTransferAmount, rFee);
    }

    //Get current actual / reflected exchange rate
    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (
                _rOwned[_excluded[i]] > rSupply ||
                _tOwned[_excluded[i]] > tSupply
            ) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]], "sub rSupply");
            tSupply = tSupply.sub(_tOwned[_excluded[i]], "sub tSupply");
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    function removeAllFee() private {
        if (!feeIt) return;
        feeIt = false;
    }

    function restoreAllFee() private {
        feeIt = true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _takeBurn(address sender, uint256 tBurn) private {
        uint256 currentRate = _getRate();
        uint256 rBurn = tBurn.mul(currentRate);
        _rOwned[burnAddress] = _rOwned[burnAddress].add(rBurn);
        emit Transfer(sender, burnAddress, tBurn);
    }

    function _burn(address account, uint256 tBurn) internal {
        uint256 currentRate = _getRate();
        uint256 rBurn = tBurn.mul(currentRate);
        require(account != address(0), "BEP20: burn from the zero address");
        _rOwned[account] = _rOwned[account].sub(
            rBurn,
            "BEP20: burn amount exceeds balance"
        );
        _tTotal = _tTotal.sub(tBurn, "tburn err");
        emit Transfer(account, address(0), tBurn);
    }

    function burn(uint256 amount) public onlyOwner {
        _burn(burnAddress, amount);
    }

    //The administrator executes the address where dividends are not allowed
    function setExcludedDividend(address account) public onlyOwner {
        require(!_isExcludedDividend[account], "Account is already excluded");
        if (_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcludedDividend[account] = true;
        _excluded.push(account);
    }

    function setExcludedDividends(address[] memory accounts) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            address account = accounts[i];
            require(
                !_isExcludedDividend[account],
                "Account is already excluded"
            );
            if (_rOwned[account] > 0) {
                _tOwned[account] = tokenFromReflection(_rOwned[account]);
            }
            _isExcludedDividend[account] = true;
            _excluded.push(account);
        }
    }

    //The administrator can add the address of dividends, that is, delete the address where dividends are not allowed
    function removeExcludedDividend(address account) external onlyOwner {
        require(_isExcludedDividend[account], "Account is already included");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcludedDividend[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function setExcludedFeeFrom(address account) public onlyOwner {
        require(
            !_isExcludedFeeFrom[account],
            "Account is already excluded fee"
        );
        _isExcludedFeeFrom[account] = true;
    }

    function setExcludedFeesFrom(address[] memory accounts) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            address account = accounts[i];
            require(
                !_isExcludedFeeFrom[account],
                "Account is already excluded"
            );
            _isExcludedFeeFrom[account] = true;
        }
    }

    function removeExcludedFeeFrom(address account) external onlyOwner {
        require(_isExcludedFeeFrom[account], "Account is already included");
        _isExcludedFeeFrom[account] = false;
    }

    function setExcludedFeeTo(address account) public onlyOwner {
        require(!_isExcludedFeeTo[account], "Account is already excluded fee");
        _isExcludedFeeTo[account] = true;
    }

    function setExcludedFeesTo(address[] memory accounts) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            address account = accounts[i];
            require(!_isExcludedFeeTo[account], "Account is already excluded");
            _isExcludedFeeTo[account] = true;
        }
    }

    function removeExcludedFeeTo(address account) external onlyOwner {
